	(28, '520', '                    LINHA: T.CENTRAL/MURICI | 520\r\n\r\n                    Central de Atendimento (41) 3035-3075 | www.VEMSAOJOSE.com.br\r\n\r\n                        Terminal Central | Terminal Afonso Pena | Marcelino Nogueira\r\n\r\nLINHA TERMINAL CENTRAL - MURICI - 520\r\n\r\nDIAS ÚTEIS          SÁBADOS         DOMINGOS/FERIADOS\r\n\r\nSAÍDAS              SAÍDAS          SAÍDAS\r\n\r\nTC      MURICI      TC      MURICI  TC             MURICI\r\n\r\n06:00   06:45*      06:40   07:10*  08:30          09:00\r\n\r\n06.45   07.20       12:25*  12:55   16:30          17:00\r\n\r\n07:30   08:15       17:00*  17:30\r\n\r\n11.15   11.50\r\n\r\n11:40   12:25       EM VIGOR À PARTIR DE:\r\n\r\n12.20   12.50       01/03/2014.\r\n\r\n13:05*  13:40*\r\n\r\n16:30*  17:15\r\n\r\n16.40   17.15\r\n\r\n18:10*  18:45\r\n\r\nOBSERVAÇÕES:\r\n\r\nOs horários com asterisco terão como itinerário a estrada do Mergulhão\r\n\r\nAs 2ª e 5ª feiras os horáeios de 07:30, 13.05 e 16.30h,   saídas                      do  Ter-\r\n\r\ncentral, deverão ir até a Igreja da Antinha  passando pela casa do                        Sr.\r\n\r\nManoel Lopes. Quando for feriado fazer no dia seguinte.\r\n\r\nO horário da Muirici 08:15 às 2ª e 5ª feiras deverá sair do Avencal 08:10h.\r\n\r\n4ª feira os horários 07:30 e 16:30h com saída do Terminal Central, terão\r\n\r\no seguinte itinerário: Estrada da Murici, Estrada  do    Mergulhão,                   Capão\r\n\r\nGrosso, Avencal e Murici, quando 4ª feira for feriado fazer na 6ª feira.\r\n\r\nÀs 6ª feiras o horáio de 18:10 saída do terminal central tem como ponto\r\n\r\ninicial e final a Mercearia do Romão na Estrada do Avencal.\r\n\r\nDe segunda a sexta-feira, os horários de 06:00 e 11:40, saídas do Ter-\r\n\r\nminal Central, farão itinerário normal da linha até a Rua Dr. Murici, de-\r\n\r\npois, Rua Julio Cezar Setenarski, Rua João Bortolan até próximo ao\r\n\r\nPesque e pague do Cachimbo, Rua Miguel Bassa, Emerson Greboge\r\n\r\naté a Igre